function listar() {
    //TODO - CENTRALIZAR ISSO EM ALGUM CANTO
    var mysql = require('mysql');

    var connection = mysql.createConnection({
        host: 'localhost',
        user: 'test',
        password: 'test',
        database: 'cursosDB'
    });


    connection.connect(function (err) {
        if (err) throw err;
        connection.query("SELECT * FROM alunos", function (err, result, fields) {
            if (err) throw err;
            teste = result;
            console.log(teste[0]);
            //tentando entender
            for (var i = 0; i < Object.keys(teste).length; i++) {
                var tr = document.createElement("tr");
                //segundo a rapazeada do grupo tem como criar um id direto no create element
                tr.setAttribute("id", i);

                tr.onclick = function () {
                    selecao = this.id;
                    console.log(teste[selecao].id_aluno);
                    nome = String(teste[selecao].nome);
                };

                var div = document.getElementById("tbody");
                //verificar
                for (var cell = 0; cell < document.getElementById("table").rows[0].cells.length; cell++) {

                    tr.innerHTML = '<td>' + teste[i].id_aluno + '</td>' +
                        '<td>' + teste[i].nome + '</td>' +
                        '<td>' + teste[i].rg + '</td>' +
                        '<td>' + teste[i].cpf + '</td>' +
                        '<td>' + teste[i].celular + '</td>' +
                        '<td>' + teste[i].email + '</td>' +
                        '<td>' + teste[i].matricula + '</td>' +
                        "<td><a onclick='deletar()' class='btn blue'>delete</a><a onclick='gerarPDF()' class='btn green'>Gerar certificado</a></td>";
                }
                div.appendChild(tr);

            }



        });
    });




}
