function gerarPDF() {
    var doc = new jsPDF({
        orientation: 'landscape',
    });
    
    var imgData = ""; // base-64
    
    //(inner) addImage(imageData, format, x, y, width, height, alias, compression, rotation)
    doc.addImage(imgData, 'JPEG', 0, 0, 300, 200);
    now = new Date;
    doc.setFontSize(18);
    //o primeiro <- -> o segundo cima e baixo 
    doc.text(String(now.getDate()) + "/" + String(now.getMonth()+1) + "/" + String(now.getFullYear()), 75, 160);
    doc.text(nome, 80, 135);
    doc.save(String(nome) + '_certificado.pdf');
}